import { addtocart } from '../actions/Cartactions'
function Cartscreen() {
  const {rid}=useParams()
  const {mid}=useParams()
  alert(rid)
const dispatch=useDispatch()
useEffect(()=>{
  if(rid)
  {
    dispatch(addtocart(rid))
  }
})
